// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAuth } from 'firebase/auth';
import { getDatabase, ref } from 'firebase/database'; // Import getDatabase function

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyBapmKJX0xD3YiX9nVYQwCSXavvvNgFQiQ",
  authDomain: "admin-panel-50ad1.firebaseapp.com",
  projectId: "admin-panel-50ad1",
  storageBucket: "admin-panel-50ad1.appspot.com",
  messagingSenderId: "85802758585",
  appId: "1:85802758585:web:36979e42abcdcd5c1e4668",
  measurementId: "G-J7MC73HMRF"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const database = getDatabase(app); // Access the database using getDatabase function
export default database; // Export the database object
export const auth = getAuth(app);
export const databaseRef = ref(database); // Create a reference to the root of the database
